တဲ့ ေနရာတစ္ခု ျဖစ္ခဲ့ပါတယ္။ အာကာသပညာရွင္မ်ား ေစာင့္ၾကည့္ေလ့လာတဲ့အခါ မုန္တိုင္းဟာ ပိုမိုလင္းလက္လာတာကို ျမင္ေတြ႕ရပါတယ္။ (ဒုတိယပံု)\n\nနက္ပကြ်န္းမွာ တိုက္ခတ္ေနတဲ့ အျခားမုန္တိုင္းႀကီးေတြလည္းရွိပါတယ္။ နာဆာရဲ႕ ဗိုေရဂ်ာ အာကာသယာဥ္ဟာ ေနအဖြဲ႕အစည္းက မထြက္ခြာမီ နက္ပကြ်န္းကို အမိအရ အနီးကပ္ေလ့လာခဲ့တဲ့ တစ္ခုတည္းေသာ အာကာသယာဥ္ျဖစ္ခဲ့ပါတယ္။ အေမွာင္မဲဆံုးေနရာ (Great Dark Spot) ကေတာ့ အႀကီးမားဆံုး မုန္တိုင္းႀကီးတစ္ခုျဖစ္ၿပီး သူ႔အနီးနားမွာ အျဖဴေရာင္တိမ္စိုင္မ်ားလည္း ျမင္ေတြ႕ရမွာပါ။ (တတိယပံု)\n\nနက္ပကြ်န္းဟာ ဟိုက္ဒ႐ိုဂ်င္ဓါတ္ေငြ႕ အမ်ားစု၊ ဟီလီယံဓါတ္ေကြ႕ အနည္းငယ္နဲ႔ မီသိန္း ဓါတ္ေငြ႕မ်ား ပါဝင္စုဖြဲ႕ထားတဲ့ ဓါတ္ေငြ႕ေဘာလံုးၿဂိဳဟ္ႀကီးျဖစ္ပါတယ္။ မီသိန္းပါဝင္တဲ့ အေပၚယံ ေလထုဟာ ေနမွ လွိုင္းအလ်ား ရွည္ေသာ အနီေရာင္ကို စုပ္ယူၿပီး.. အျပာေရာင္ကို ျပန္လည္ေရာင္ျပန္ေပးတဲ့အတြက္ ၿဂိဳဟ္ရဲ႕အေရာင္ဟာ အျပာေရာင္ျဖစ္ေနရျခင္း ျဖစ္ပါတယ္။ အျပာေရာက္ျဖစ္ေနတဲ့အတြက္ သူ႔ကို ဂရိ ေရ နတ္ဘုရား ပိုဆီတြန္ (နက္ပကြ်န္း) အမည္ကို မွည့္ေခၚထားျခင္း ျဖစ္ပါေတာ့တယ္။ \n\nအသစ္ေတြ႕ရွိတဲ့ မုန္တိုင္းႀကီးကိုေတာ့ အေသးစိပ္ေလ့လာသံုးသပ္ၿပီး ေနာက္လာမယ္ ႏိုင္ငံတကာ သင္႐ိုးသစ္မ်ားမွာ ထည့္သြင္းေရးသားသြားမွာ ျဖစ္ပါတယ္။ \n\nအနာဂတ္ပညာေရးအတြက္..\n\nသန္႔ဦး (အာကာသႏွင့္ စၾကဝဠာ)','U Mya','092535554167','Daw Hla ','09543546175','2017-08-04 21:05:17','2017-08-04 21:38:20',1,0),('1d78d51539584d399b27e756bac4824e','e0f0d9668bc444e49eb7cc0c375bc20f','bbj',NULL,'bnkk',61,59,0,NULL,5,1,'999','jjjkk','','bjjkk','jkkk','99','bjjkk','99','2017-07-25 15:20:43','2017-07-25 15:26:00',1,0),('1d81c21f0d0e4c30a7ea2349bbdbb155','44f63839e7e84779baabe92449c705ce','gsuxhxuxjx','1500267821_FB_IMG_1500048392663.jpg','gsyxyxuzususus',61,59,0,NULL,1,1,'87886864','vshxhxud@gmail.com','','vxhxhxuus','vsxjsjss','87886864','czgshssuss','79767664','2017-07-17 10:03:41','2017-07-17 10:03:45',1,1),('1dc168b527da4fc1b13172454b524f1f','e0f0d9668bc444e49eb7cc0c375bc20f','cvh',NULL,'fhj',61,59,0,NULL,5,1,'89','ghj','xxx.xxxxxxx.xxx','dfghjbvdfghhjjjhgddhffyfhdhdffuggifufjffufufufufufufjfffufufuffugufufufufufjdfgggghhggghhhhhhhhhhhhhhhhhhjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjj