n. Ando is a solid fighter with experience,” Nastyukhin acknowledges. “He has 12 wins, and some of them are over tough opponents, such as former ONE Featherweight World Champion Narantungalag Jadambaa. Also, he challenged Shinya Aoki for the ONE Lightweight World Title. This fight is not going to be a walk in the park for me.”\r\n\r\nAndo was on an impressive five-fight win streak until he dropped a unanimous decision to Aoki in their title clash back in May 2015. He came back with a decision win over Roger Huerta that September, but fell to unbeaten Hawaiian Lowen Tynanes in his last contest seven months later.\r\n\r\nThe return into the cage is likely to be an emotional one for Nastyukhin, who suffered a serious leg injury during his most recent bout against Kotetsu “No Face” Boku at ONE: DEFENDING HONOR in November.\r\n\r\nAfter connecting with a low roundhouse kick to the Japanese competitor, Nastyukhin’s own right leg buckled. A warrior with immense heart and spirit, the Russian still finished the opening stanza.\r\n\r\n“After that injury, I had a tough decision to make: do I stay in this sport or do I quit,” he states. “I am a fighter. That is my job, so I stayed. And now, after a surgery in Singapore and eight months of rehab in Russia, I am hungry to step back into the cage.”\r\n\r\n￼\r\n\r\nTo prepare for his comeback, Nastyukhin headed to the mountains of Ossetia, an area in Russia that has given the world the most Olympic champions in wrestling.\r\n\r\n“That place is legendary. More and more international teams train there,” he says. “I bumped into a team from an American University, and though the media says we Russians do not like Americans, we helped them train!”\r\n\r\nNastyukhin got back into shape by concentrating on his wrestling and physical conditioning. “I trained with my long-term sparring partner Andrei Koreshkov. He is a similar size to Koji. I trained with him and with slightly bigger guys, getting used to working with heavier weights, as I 